import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

import "../styles/App.css";
import "../styles/bootstrap.min.css";


class ShowTransaksi extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    let ID = ID + 1;
    return (
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td>ID</td>
          <td>{props.listTransaksi.produk_nama}</td>
          <td>Toko A</td>
          <td>Rp. 2.000.000</td>
          <td>2</td>
          <td>Rp. 4.000.000</td>
          <td>Ya</td>
          <td>10-03-2019</td>
          <td>Credit Card</td>
        </tr>
      </tbody>
    );
  } 
}

ShowTransaksi.propTypes = {
  gambar : PropTypes.string, 
  nama : PropTypes.string,
  hargaAwal : PropTypes.number,
  hargaAkhir : PropTypes.number,
  deskripsi : PropTypes.string
} 

export default ShowTransaksi;
